import React, { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom'
import EmployeeService from '../services/EmployeeService';
import Employees from './Employees';

const EmployeeList = () => {
  const navigate =useNavigate();

 const [employees, setemployees] = useState(null);
 const [loading, setLoading] = useState(true);

 useEffect(() => {
   const fetchData = async () => {
     setLoading(true);
     try{
      const response = await EmployeeService.getEmployeeList();
      setemployees(response.data);
     }catch(error){
       console.log(error);
     }
     setLoading(false);
   }
   fetchData();
 }, [])
 
 

  return (
    
    <div className='container mx-auto my-8'>
      <div className='h-12'>
     <button className='rounded bg-slate-600 text-white px-6 py-2'
     onClick={() => navigate("/addEmployee")}>
       Add Employee</button>
      </div>
      <div className='flex shadow border-b'>
        <table className='min-w-full'>
          <thead className='bg-gray-50'>
            <tr>
              <th className='text-left font-medium text-gray-500 uppercase tracking-wider py-3 px-6'>First Name</th>
              <th className='text-left font-medium text-gray-500 uppercase tracking-wider py-3 px-6'>Last Name</th>
              <th className='text-left font-medium text-gray-500 uppercase tracking-wider py-3 px-6'>Email</th>
              <th className='text-right font-medium text-gray-500 uppercase tracking-wider py-3 px-6'>Action</th>
            </tr>
          </thead>

          {!loading && (
          <tbody>
            {employees.map((employee) => (
            <Employees employee={employee}></Employees>
           ))}
          </tbody>
          )}
        </table>
      </div>
    </div>
  )
}

export default EmployeeList
